import axios from 'axios';

const URL= 'https://travel-advisor.p.rapidapi.com/restaurants/list-in-boundary';


const options={
    params:{
        bl_latitude: '11.84',
        tr_latitude: '12.83',
        bl_longitude: '109.09',
        tr_longitude: '109.14',
    },
    headers: {
        'x-rapidapi-host': 'travel-advisor.p.rapidapi.com',
        'x-rapidapi-key': '3ae4440b4emshfb1681d5c80ef22p1eb9bajsn7584cb46863c'
     },
};




export const getPlacesData= async(sw,ne)=>{
    try{
        const {data:{ data } }=await axios.get(URL, {
            params: {
                bl_latitude: sw.lat,
                tr_latitude: ne.lat,
                bl_longitude: sw.lng,
                tr_longitude: ne.lng,
            },
            headers: {
                'x-rapidapi-host': 'travel-advisor.p.rapidapi.com',
                'x-rapidapi-key': '3ae4440b4emshfb1681d5c80ef22p1eb9bajsn7584cb46863c'
            },
         });

        return data;
    }
    catch(error){
        console.log(error);
    }
}
